  [],\n\t\"revision_timestamp\": \"2015-11-20T22:44:11.415680\",\n\t\"name\": \"number-of-migration-scenarios-passing-through-each-huc-future\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Forest dwelling neotropical migratory birds
  require intact forested stopovers during migration. The number of paths that pass
  through a HUC highlight that huc's importance in the migratory system. I modeled
  migratory flights based on flight distance and direction to examine how nightly
  flights link stopovers into flyways. The resulting maps highlight portions of the
  landscape that are important for the continued success of migratory birds. Areas
  where many different migration scenarios overlap are particularly important, as
  these areas will support a diverse collection of migratory strategies and populations.
  More information about these resources, including the variables used in this study,
  may be found here: https://edg.epa.gov/data/Public/ORD/NERL/ReVA/ReVA_Data.zip.\",\n\t\"license_title\":
